एक आयताकार मैदान को एक एथलेटिक ट्रैक में घेरा गया है, जैसा कि नीचे दिखाया गया है। ट्रैक में मैदान के दो किनारे और दो अर्धवृत्त शामिल हैं। ट्रैक की लंबाई 400 मीटर है। मैदान का सबसे बड़ा संभव क्षेत्रफल, वर्ग मीटर में, क्या है?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

